import "./App.css";
import React from "react";

class App extends React.Component {
  str = "";
  constructor(props) {
    super(props);
    this.state = {
      count: 0,
    };
  }

  counter() {
    this.setState({
      count: this.state.count + 1,
    });
  }

  render() {
    return (
      <div className="App">
        <br />
        <button
          onClick={() => {
            this.counter();
          }}
        >
          Count
        </button>
        <br />
        {this.state.count}
      </div>
    );
  }
}
export default App;
